import React from "react";

import NamelistItem from "./NamelistItem";

function Namelist(){
    const name=[{
        name:{
            first:"Ahmed",
            last:"Anwer"
        },
        age:9
    },
    {
        name:{
            first:"Mohamed",
            last:"Anwer"
        },
        age:10
    },
    {
        name:{
            first:"Hello",
            last:"How"
        },
        age:15
    }];
    return(
        <div>
            <ul>
                <NamelistItem name={`${name[0].name.first} ${name[0].name.last} How are `} age={name[0].age} />
                <NamelistItem name={`${name[1].name.first} ${name[1].name.last} `} age={name[1].age} />
                <NamelistItem name={`${name[2].name.first} ${name[2].name.last} `} age={name[2].age} />
                <NamelistItem name={`${name[1].name.first} ${name[3].name.last} `} age={name[3].age} />
            </ul>
        </div>
    );
}
export default Namelist;
